  \"2016-07-27T22:45:40.140962\",\n\t\"name\": \"narrative-report-for-september-october-november-and-december-1944-des-lacs-national-wildli\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Des Lacs National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1944. The report begins by summarizing the weather conditions, water conditions,
  and food and cover during this period. Wildlife- including migratory birds, upland
  game birds, big game animals, furbearers, predators, rodents, raptors, fish, and
  disease- is also covered. The Refuge development and maintenance section discusses
  physical developments. Resource management is outlined; topics include grazing,
  haying, and fur harvesting. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, hunting, fishing, and
  violations. N-R forms are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
